def show_exception_and_exit(exc_type, exc_value, tb):
    import traceback
    traceback.print_exception(exc_type, exc_value, tb)
    input("We ran into some issues. Press enter to exit.")
    sys.exit(-1)

sys.excepthook = show_exception_and_exit

